interface AggregatorV3Interface {
    function decimals() external view returns (uint8);
    function description() external view returns (string memory);
    function version() external view returns (uint256);
    function getRoundData(
        uint80 _roundId
    )
        external
        view
        returns (
            uint80 roundId,
            uint256 answer,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        );
    function latestRoundData()
        external
        view
        returns (
            uint80 roundId,
            uint256 answer,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        );
}
contract PriceConsumerV3 {
    AggregatorV3Interface internal priceFeed;
    function getLatestPrice() public view returns (uint) {
        (, uint price, , , ) = priceFeed.latestRoundData();
        return uint256(price);
    }
}


interface IUniswapV2Factory {
    function createPair(
        address tokenA,
        address tokenB
    ) external returns (address pair);
}

interface IUniswapV2Router02 {
    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external;

    function factory() external pure returns (address);

    function WETH() external pure returns (address);

    function addLiquidityETH(
        address token,
        uint256 amountTokenDesired,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline
    )
        external
        payable
        returns (uint256 amountToken, uint256 amountETH, uint256 liquidity);
}

contract testnewpeep is Context, IERC20, Ownable {
    using SafeMath for uint256;
    uint8 public immutable divided = 100;
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalSupply;

    uint256 public tax;
    uint256 public limitTaxes = 1000000000000000000000;

    uint256 public marketingFee;

    IUniswapV2Router02 private uniswapV2Router;
    address private uniswapV2Pair;
    bool public SwapEnabled;

    address payable public marketingWallet;

    mapping(address => uint256) private balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => bool) public ExcludedFromFee;

    event investWallet(address indexed wallet);
    event mainWallet(address indexed wallet);
    event marketWallet(address indexed wallet);
    event MonthlyWithdrawal(
        address indexed recipient,
        uint256 amount,
        uint256 timestamp
    );

    constructor() {
        name = "Percocet Pepe";
        symbol = "PERC30";
        decimals = 18;
        totalSupply = 420690000000000 * 10 ** uint256(decimals);
        balances[owner()] = (totalSupply);
        ExcludedFromFee[owner()] = true;
        ExcludedFromFee[address(this)] = true;
        ExcludedFromFee[marketingWallet] = true;

        marketingFee = 5;

        marketingWallet = payable(0x01A0E4172C0450aF8f4D26aF92E02Dd76eCd4c01);

        uniswapV2Router = IUniswapV2Router02(
            0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D
        );

        uniswapV2Pair = IUniswapV2Factory(uniswapV2Router.factory()).createPair(
            address(this),
            uniswapV2Router.WETH()
        );

        emit Transfer(address(0), msg.sender, totalSupply);
    }

    function balanceOf(address account) public view override returns (uint256) {
        return balances[account];
    }

    function transfer(
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(
        address _owner,
        address spender
    ) public view override returns (uint256) {
        return _allowances[_owner][spender];
    }

    function approve(
        address spender,
        uint256 amount
    ) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }

    function _approve(address owner_, address spender, uint256 amount) private {
        require(owner_ != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");
        _allowances[owner_][spender] = amount;
        emit Approval(owner_, spender, amount);
    }

    function setLimitTaxes(uint256 newLimit) external onlyOwner {
        limitTaxes = newLimit;
    }

    function setExcludedFromFee(
        address account,
        bool isExcluded
    ) external onlyOwner {
        if (ExcludedFromFee[account] != isExcluded) {
            ExcludedFromFee[account] = isExcluded;
        } else {
            revert("Exclusion status is already set to the desired value");
        }
    }

    function setmarketingWallet(address wallet) external onlyOwner {
        require(wallet != address(0), "Invalid wallet address");
        marketingWallet = payable(wallet);
        emit investWallet(wallet);
    }

    function setTaxPercentages(uint256 _marketingFee) public onlyOwner {
        marketingFee = _marketingFee;
    }

    function pauseTrading() external onlyOwner {
        SwapEnabled = false;
    }

    function StartTrading() external onlyOwner {
        require(!SwapEnabled, "Trading is already enabled");
        SwapEnabled = true;
    }

    function _transfer(address from, address to, uint256 amount) internal {
        require(amount > 0, "Transfer amount must be greater than zero");
        require(amount <= balances[from], "Insufficient balance");
        if (from == uniswapV2Pair || to == uniswapV2Pair) {
            if (!ExcludedFromFee[from] && !ExcludedFromFee[to]) {
                uint256 _marketingFee = amount.mul(marketingFee).div(divided);

                tax = tax.add(_marketingFee);

                uint256 transferAmount = amount.sub(_marketingFee);

                balances[from] = balances[from].sub(amount);
                balances[to] = balances[to].add(transferAmount);
                emit Transfer(from, to, transferAmount);
                balances[address(this)] = balances[address(this)].add(
                    _marketingFee
                );
                emit Transfer(from, address(this), _marketingFee);
            } else {
                balances[from] = balances[from].sub(amount);
                balances[to] = balances[to].add(amount);
                emit Transfer(from, to, amount);
            }
        } else {
            balances[from] = balances[from].sub(amount);
            balances[to] = balances[to].add(amount);
            emit Transfer(from, to, amount);

            bool shouldSell = tax >= limitTaxes;

            if (SwapEnabled && shouldSell && from != uniswapV2Pair) {
                swapTokensForMarketing(tax);
                _distributeTax();
                tax = 0;
            }
        }
    }

    function _distributeTax() internal {
        uint256 contractETHBalance = address(this).balance;
        uint256 totaltax = marketingFee;
        uint256 investment = (contractETHBalance).mul(marketingFee).div(
            totaltax
        );

        payable(marketingWallet).transfer(investment);
    }

    function swapTokensForMarketing(uint256 tokenAmount) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();
        _approve(address(this), address(uniswapV2Router), tokenAmount);
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp + 360
        );
    }

    function withdrawEth(uint256 amount) external onlyOwner {
        require(
            amount <= address(this).balance,
            "Insufficient contract balance"
        );
        payable(msg.sender).transfer(amount);
    }

    receive() external payable {}
}

